  UNIQUE KEY `bizOrderNo_UNIQUE` (`bizOrderNo`),
  UNIQUE KEY `uidx_c_b` (`customerId`,`bizOrderNo`,`productType`),
  KEY `idx_product_type` (`productType`)
) ENGINE=InnoDB AUTO_INCREMENT=397 DEFAULT CHARSET=utf8;
